import { __decorate } from "tslib";
import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { RouterModule } from '@angular/router';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { HttpClientModule } from '@angular/common/http';
import 'hammerjs';
import { NgbModule } from '@ng-bootstrap/ng-bootstrap';
import { TranslateModule } from '@ngx-translate/core';
import { ToastrModule } from 'ngx-toastr'; // For auth after login toast
import { CoreModule } from '@core/core.module';
import { CoreCommonModule } from '@core/common.module';
import { CoreSidebarModule, CoreThemeCustomizerModule } from '@core/components';
import { coreConfig } from 'app/app-config';
import { AppComponent } from 'app/app.component';
import { LayoutModule } from 'app/layout/layout.module';
import { SampleModule } from 'app/main/provider/sample.module';
import { ListProviderComponent } from './main/provider/list-provider/list-provider.component';
import { SaveProviderComponent } from './main/provider/save-provider/save-provider.component';
const appRoutes = [
    {
        path: 'pages',
        loadChildren: () => import('./main/pages/pages.module').then(m => m.PagesModule)
    },
    {
        path: '',
        redirectTo: '/home',
        pathMatch: 'full'
    },
    {
        path: '**',
        redirectTo: '/pages/miscellaneous/error' //Error 404 - Page not found
    }
];
let AppModule = class AppModule {
};
AppModule = __decorate([
    NgModule({
        declarations: [AppComponent, ListProviderComponent, SaveProviderComponent],
        imports: [
            BrowserModule,
            BrowserAnimationsModule,
            HttpClientModule,
            RouterModule.forRoot(appRoutes, {
                scrollPositionRestoration: 'enabled',
                relativeLinkResolution: 'legacy'
            }),
            TranslateModule.forRoot(),
            //NgBootstrap
            NgbModule,
            ToastrModule.forRoot(),
            // Core modules
            CoreModule.forRoot(coreConfig),
            CoreCommonModule,
            CoreSidebarModule,
            CoreThemeCustomizerModule,
            // App modules
            LayoutModule,
            SampleModule
        ],
        bootstrap: [AppComponent]
    })
], AppModule);
export { AppModule };
